import React, { Component } from 'react';
import User from '../../components/User/User';

class Index extends Component {

    static getInitialProps(context) {
        console.log(context);
        return {};
    }


    render() {
        return (
            <div>
                <h1>hello from auth folder</h1>
                <User name={'Itay'} age={25}/>
                
            </div>
        );
    }
}

export default Index;
